&lt;b&gt;MATRIX V2 Inflatable Double Rider Towable&lt;/b&gt;Get way up on edge with MATRIX! These U-shaped winged towables roll way up on edge when riders shift their weight. The wings also make them a joy to tow, they slide effortlessly across wakes. No expense was spared in MATRIXs state-of-the-art construction. Theyre thicker at the front to prevent submarining and thin at the back to make it easier to climb on from the water. The deluxe handles have neoprene knuckle guards. Two oversized neoprene pads are strategically located to protect knees and elbows. The durable 30 gauge RF welded PVC bladder is completely wrapped in double-stitched 840-denier nylon. A heavy-duty  Kwik-Connect provides easy hook-ups and the Boston valve makes it easy and fast to deflate and inflate. &lt;b&gt;Features:&lt;/b&gt;&lt;ul&gt;
&lt;li&gt;U-shaped winged towable &lt;/li&gt;
&lt;li&gt;Thick front &amp; thin back prevent submarining and make boarding easy &lt;/li&gt;
&lt;li&gt;Heavy-Gauge PVC Bladder with RF welded seams &lt;/li&gt;
&lt;li&gt;Double-Stitched Full Nylon Cover &lt;/li&gt;
&lt;li&gt;Deluxe nylon handles with neoprene knuckle guards &lt;/li&gt;
&lt;li&gt;Boston Valve for convenient inflating and deflating &lt;/li&gt;
&lt;li&gt;Kwik-Connect tow point for fast hook-ups &lt;/li&gt;
&lt;li&gt;2 Rider capacity &lt;/li&gt;
&lt;li&gt;74 x 64 (deflated)&lt;/li&gt;
&lt;/ul&gt; &lt;!--- cis:y4w2Om4GJ5A= ---&gt;AIRHEAD Matrix V-2&lt;p&gt;&lt;u&gt;Condition&lt;/u&gt; : This item is brand new, unopened and sealed in its original factory box.&lt;/p&gt;

